import Link from 'next/link';


const About = () => (
<div>
  <ul>
    <li><Link href="/"></Link><a>Home</a></li>
    <li><Link href="/about"></Link><a>About</a></li>
  </ul>

  <h1>About BitzPrice:</h1>
  <p>Your application to monitor active bitcoin pricing.</p>
</div>
);

export default About;
